  `transfer_time` int(10) DEFAULT '0' COMMENT '线下转账时间',
  `transfer_end_time` int(10) DEFAULT '0' COMMENT '线下转账审核时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `match_id` (`match_id`,`uid`),
  KEY `created_at` (`created_at`),
  KEY `status` (`status`),
  KEY `pay_status` (`pay_status`),
  KEY `transfer_status` (`transfer_status`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COMMENT='赛程报名表';

