/*Table structure for table `qo_match_groups` */

DROP TABLE IF EXISTS `qo_match_groups`;

CREATE TABLE `qo_match_groups` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '赛组ID',
  `match_id` int(10) NOT NULL DEFAULT '0' COMMENT '赛程ID',
  `group_title` varchar(200) NOT NULL COMMENT '赛组名称',
  `group_content` text COMMENT '赛组描述',
  `created_at` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `match_id` (`match_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COMMENT='赛程 - 赛组表';

/*Data for the table `qo_match_groups` */

insert  into `qo_match_groups`(`id`,`match_id`,`group_title`,`group_content`,`created_at`,`updated_at`) values (1,3,'[一] 锦标赛组 比赛规定和设项','&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;一、锦标赛各组奖励设置：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	&lt;span&gt;锦标赛各组奖励前六名，前三名颁发奖金、奖杯、证书；&lt;/span&gt;4-6名颁发奖杯、证书。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&lt;span&gt;二、锦标赛各组奖金设置如下（奖金总额&lt;/span&gt;12万元）：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;注明：锦标赛组别：&lt;/b&gt;&lt;b&gt;&lt;span&gt;（注明：不足&lt;/span&gt;6对选手参赛，比赛不发奖金；不足3对选手参赛，比赛取消。）&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	1、职业组比赛奖金：第一名5000元、第二名3000元、第三名2000元，\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	2、A 组 &amp;nbsp;比赛奖金：第一名3000元、第二名2000元、第三名1000元，\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	3、双人精英组比赛奖金：第一名800元、第二名600元、第三名400元，\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	4、单人精英组比赛奖金：第一名500元、第二名400元、第三名300元，\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;三、锦标赛组比赛规定：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	1、职业组选手禁报专业组、业余组比赛，专业院校学生，禁报业余组别比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	2、同一对双人精英组选手不能兼报参加多个精英组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.7500pt;&quot;&gt;\r\n	3、13岁或以下年龄组的服装和动作按规定执行。\r\n&lt;/p&gt;',1481111485,1481111909),(2,3,'[二] 常规赛专业组 比赛规定和设项','&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;一、奖励设置：&lt;/b&gt;专业组奖励前六名，前三名颁发奖杯、证书；四至六名颁发证书。&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;二、比赛规定：&lt;/b&gt;职业组选手禁止报名。1&lt;b&gt;&lt;/b&gt;\r\n&lt;/p&gt;',1481111542,1481111920),(3,4,'A赛组','',1482419203,1482419203),(4,5,'1','1',1483024569,1483024569),(5,6,'测试赛组','',1483686982,1483686982),(6,8,'A组','',1483796381,1483796381);

