/*Table structure for table `qo_match_ipates@DELETE` */

DROP TABLE IF EXISTS `qo_match_ipates@DELETE`;

CREATE TABLE `qo_match_ipates@DELETE` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '赛程板块ID',
  `match_id` int(10) NOT NULL COMMENT '赛程ID',
  `name` varchar(100) NOT NULL COMMENT '板块名称',
  `ident` varbinary(20) DEFAULT '' COMMENT '（一级板块专用）一级板块唯一标识，在创建赛程的时候生成、不可删除，修改；PROC为职业组；SPEC为专业组;AMAT为业余组',
  `is_cross` tinyint(2) DEFAULT '0' COMMENT '是否允许二级板块跨类报名（一级板块专用）。0为不允许，1为允许',
  `created_at` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `match_id` (`match_id`),
  KEY `is_cross` (`is_cross`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COMMENT='赛程板块表';

/*Data for the table `qo_match_ipates@DELETE` */

insert  into `qo_match_ipates@DELETE`(`id`,`match_id`,`name`,`ident`,`is_cross`,`created_at`,`updated_at`) values (1,4,'职业组','PROC',1,1481767631,1482417299),(2,4,'专业组','SPEC',0,1481767631,1482417295),(3,4,'业余组','AMAT',0,1481767631,1481767631),(6,4,'师生组','',0,1482418972,1482418996);

/*Table structure for table `qo_match_player_backs` */

