; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	5、已报单人精英组的选手，不能兼报常规赛同龄单人组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	6、双人组选手，是以年龄大的选手为准，报相应年龄组别比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;7、每名选手最多可兼报4个项目。注意，由此引起选手检录误场责任自负。&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;六、比赛服务费：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;span&gt;报名费必须于&lt;/span&gt;2016年12月17日前在报名系统中线上支付，或线下汇款(或转账)到组委会指定账户：\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span&gt;交通银行佛山分行，户名：陈莘，账号&lt;/span&gt;:&lt;/b&gt;&lt;b&gt;&amp;nbsp;6222 6237 1000 3511 859&lt;/b&gt;&lt;b&gt;，&lt;/b&gt;&lt;span&gt;报名表经赛会确认后，不得更改。若因特殊原因更改，则需缴纳更改费&lt;/span&gt;200元/组(项)。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;七、裁判、领队报到：&lt;/b&gt;&lt;b&gt; &lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	1、报到：各参赛领队于12月23日中午12:00前，报到，领取选手背号。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、裁判、领队会议：12月23日下午14:00召开裁判、领队会议。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	3、报到和裁判、领队会议地址：佛山市禅城区卫国路，佛山体育馆后座训练馆顶层，广东省青少年舞蹈协会（总部）佛山市禅舞培训中心。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、比赛日：2016年12月25日8:00，裁判员开赛前会议、选手8:00时开始检录，8:30时开始比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;八、比赛设项规定：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 标准舞系列：W 华尔兹、T 探戈、VW 维也纳华尔兹、F 狐步、Q 快步\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 拉丁舞系列：C 恰恰恰、R 伦巴、J 牛仔、S 桑巴、P 斗牛\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	5支舞：标准舞：W、T、VW、F、Q；拉丁舞：S、C、R、J、P 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	4支舞：标准舞：W、T、VW、Q；拉丁舞：S、C、R、J 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	3支舞：标准舞：公开组W、T、VW&lt;b&gt;&lt;span&gt;（少年组&lt;/span&gt;W、Q、VW）&lt;/b&gt;&lt;span&gt;；&lt;/span&gt; &lt;span&gt;拉丁舞：&lt;/span&gt;C、R、J 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	2支舞：标准舞：公开组W、T；少年组W、Q；拉丁舞：C、R 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;九、竞赛规定：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;1、&lt;/b&gt;&lt;b&gt;&lt;span&gt;锦标赛组别注明：不足&lt;/span&gt;6对选手参赛，比赛不发奖金；不足3对选手参赛，比赛取消。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、13岁或以下年龄组的服装和动作按规定执行。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:25.6000pt;&quot;&gt;\r\n	3、参加颁奖仪式选手须着比赛服装。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、参加各年龄组比赛的选手，必须随身携带身份证或户口本原件备查。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;5、比赛期间不接受选手投诉，投诉必须于比赛后由领队缴交500元投诉费，并以书面形式交仲裁委员会处理，投诉失败则不退还投诉费。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.5500pt;&quot;&gt;\r\n	6、参赛运动员禁用违禁药物。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.5500pt;&quot;&gt;\r\n	7、参赛运动员须由组队单位（或个人）购买比赛当日的意外保险；&lt;b&gt;谢绝患有疾病，特别是心脑血管及高血压疾病患者参赛&lt;/b&gt;；&lt;span&gt;若隐瞒病情参赛，则比赛期间一切意外事故的责任由选手自负，大赛组委会不承担任何后果及责任。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;十、本竞赛规程最终解释权属主办单位，未尽事宜，另行通知。&lt;/b&gt; \r\n&lt;/p&gt;','13312341234',1481472000,1485273600,1482076800,1482508800,1483113600,13,4,0,1481767631,1487498798),(6,'2016年南海地区标准舞、拉丁舞年度半决赛','&lt;p&gt;\r\n	2016/01/03添加的测试赛事\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;img src=&quot;/Uploads/2017-01-03/586baa4490c80.jpg&quot; alt=&quot;&quot; /&gt; \r\n&lt;/p&gt;','18672197927',1483450960,1483804800,1483977600,1484841600,1483891200,1,1,0,1483450992,1486713039),(7,'2016年佛山地区标准舞、拉丁舞年度半决赛','111','13312341234',1483632000,1484582400,1484928000,1485792000,1484755200,1,1,0,1483717579,1486713013),(8,'2016年广东省标准舞、拉丁舞年度总决赛','&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;b&gt;2016&lt;/b&gt;&lt;b&gt;年广东省标准舞、拉丁舞年度总决赛&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;b&gt;暨第十届珠江三角洲标准舞、拉丁舞公开赛&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;b&gt;竞赛规程&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;一、主办单位：&lt;/b&gt;佛山市禅城区文化体育局&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 广东省青少年舞蹈协会&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;二、承办单位：&lt;/b&gt;佛山市运动家文化策划有限公司&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;三、竞赛时间和地点：&lt;/b&gt;2016年&lt;span&gt;12&lt;/span&gt;月&lt;span&gt;25&lt;/span&gt;日在佛山市体育馆举行。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;四、竞赛规则：&lt;/b&gt;比赛分预赛、复赛、半决赛、决赛进行。&lt;b&gt;&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;五、参赛报名规定：（&lt;/b&gt;咨询电话：&lt;span&gt;0757-\r\n82361796&lt;/span&gt;，&lt;span&gt;18928563168&lt;/span&gt;）&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	&lt;b&gt;1&lt;/b&gt;&lt;b&gt;、报名请登录&lt;/b&gt;&lt;b&gt;&lt;a href=&quot;http://www.cwdance.cn/&quot;&gt;www.cwdance.cn&lt;/a&gt;&lt;/b&gt;&lt;b&gt;，&lt;/b&gt;&lt;b&gt;在网站的“赛事通”中报名&lt;/b&gt;。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	2、报名日期：报名系统于&lt;span&gt;12&lt;/span&gt;月&lt;span&gt;3&lt;/span&gt;日&lt;span&gt;12:00&lt;/span&gt;开启，&lt;span&gt;12&lt;/span&gt;月&lt;span&gt;11&lt;/span&gt;日&lt;span&gt;24:00&lt;/span&gt;关闭。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	3、同一对精英组选手不能兼报参加多个精英组比赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	4、已报双人精英组的同一对选手，不能兼报常规赛同龄双人组比赛，但可更换舞伴兼报常规赛同龄双人组比赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	5、已报单人精英组的选手，不能兼报常规赛同龄单人组比赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	6、双人组选手，是以年龄大的选手为准，报相应年龄组别比赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	&lt;b&gt;7&lt;/b&gt;&lt;b&gt;、每名选手最多可兼报&lt;span&gt;4&lt;/span&gt;个项目。注意，由此引起选手检录误场责任自负。&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;六、比赛服务费：&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	报名费必须于&lt;span&gt;2016&lt;/span&gt;年&lt;span&gt;12&lt;/span&gt;月&lt;span&gt;17&lt;/span&gt;日前在报名系统中线上支付，或线下汇款&lt;span&gt;(&lt;/span&gt;或转账&lt;span&gt;)&lt;/span&gt;到组委会指定账户：&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	&lt;b&gt;交通银行佛山分行，户名：陈莘，账号&lt;span&gt;: 6222 6237 1000 3511 859&lt;/span&gt;，&lt;/b&gt;报名表经赛会确认后，不得更改。若因特殊原因更改，则需缴纳更改费&lt;span&gt;200&lt;/span&gt;元&lt;span&gt;/&lt;/span&gt;组&lt;span&gt;(&lt;/span&gt;项&lt;span&gt;)&lt;/span&gt;。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;七、裁判、领队报到：&lt;span&gt; &lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	1、报到：各参赛领队于&lt;span&gt;12&lt;/span&gt;月&lt;span&gt;23&lt;/span&gt;日中午&lt;span&gt;12:00&lt;/span&gt;前，报到，领取选手背号。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	2、裁判、领队会议：&lt;span&gt;12&lt;/span&gt;月&lt;span&gt;23&lt;/span&gt;日下午&lt;span&gt;14:00&lt;/span&gt;召开裁判、领队会议。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	3、报到和裁判、领队会议地址：佛山市禅城区卫国路，佛山体育馆后座训练馆顶层，广东省青少年舞蹈协会（总部）佛山市禅舞培训中心。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	4、比赛日：&lt;span&gt;2016&lt;/span&gt;年&lt;span&gt;12&lt;/span&gt;月&lt;span&gt;25&lt;/span&gt;日&lt;span&gt;8:00&lt;/span&gt;，裁判员开赛前会议、选手&lt;span&gt;8:00&lt;/span&gt;时开始检录，&lt;span&gt;8:30&lt;/span&gt;时开始比赛。&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;八、比赛设项规定：&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 标准舞系列：&lt;span&gt;W &lt;/span&gt;华尔兹、&lt;span&gt;T &lt;/span&gt;探戈、&lt;span&gt;VW &lt;/span&gt;维也纳华尔兹、&lt;span&gt;F &lt;/span&gt;狐步、&lt;span&gt;Q &lt;/span&gt;快步&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 拉丁舞系列：&lt;span&gt;C &lt;/span&gt;恰恰恰、&lt;span&gt;R &lt;/span&gt;伦巴、&lt;span&gt;J &lt;/span&gt;牛仔、&lt;span&gt;S &lt;/span&gt;桑巴、&lt;span&gt;P &lt;/span&gt;斗牛&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2pt;&quot;&gt;\r\n	5支舞：标准舞：&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;、&lt;span&gt;VW&lt;/span&gt;、&lt;span&gt;F&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;；拉丁舞：&lt;span&gt;S&lt;/span&gt;、&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R&lt;/span&gt;、&lt;span&gt;J&lt;/span&gt;、&lt;span&gt;P &lt;/span&gt;。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2pt;&quot;&gt;\r\n	4支舞：标准舞：&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;、&lt;span&gt;VW&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;；拉丁舞：&lt;span&gt;S&lt;/span&gt;、&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R&lt;/span&gt;、&lt;span&gt;J &lt;/span&gt;。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2pt;&quot;&gt;\r\n	3支舞：标准舞：成人组&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;、&lt;span&gt;VW&lt;/span&gt;&lt;b&gt;（少年组&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;、&lt;span&gt;VW&lt;/span&gt;）&lt;/b&gt;； 拉丁舞：&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R&lt;/span&gt;、&lt;span&gt;J &lt;/span&gt;。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2pt;&quot;&gt;\r\n	2支舞：标准舞：成人组&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;&lt;b&gt;（少年组&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;）&lt;/b&gt;；拉丁舞：&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R &lt;/span&gt;。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;九、竞赛规定：&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.6pt;&quot;&gt;\r\n	&lt;b&gt;1&lt;/b&gt;&lt;b&gt;、&lt;/b&gt;&lt;b&gt;锦标赛组别注明：不足&lt;span&gt;6&lt;/span&gt;对选手参赛，比赛不发奖金；不足&lt;span&gt;3&lt;/span&gt;对选手参赛，该组别取消。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	2、&lt;span&gt;13&lt;/span&gt;岁或以下年龄组的服装和动作按规定执行。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:25.55pt;&quot;&gt;\r\n	3、参加颁奖仪式选手须着比赛服装。&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	4、参加各年龄组比赛的选手，必须随身携带身份证或户口本原件备查。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6pt;&quot;&gt;\r\n	&lt;b&gt;5&lt;/b&gt;&lt;b&gt;、比赛期间不接受选手投诉，投诉必须于比赛后由领队缴交&lt;span&gt;500&lt;/span&gt;元投诉费，并以书面形式交仲裁委员会处理，投诉失败则不退还投诉费。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.45pt;&quot;&gt;\r\n	6、参赛运动员禁用违禁药物。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.45pt;&quot;&gt;\r\n	7、参赛运动员须由组队单位（或个人）购买比赛当日的意外保险；&lt;b&gt;谢绝患有疾病，特别是心脑血管及高血压疾病患者参赛&lt;/b&gt;；若隐瞒病情参赛，则比赛期间一切意外事故的责任由选手自负，大赛组委会不承担任何后果及责任。&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;十、本竞赛规程最终解释权属主办单位，未尽事宜，另行通知。&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	附件&lt;span&gt;2&lt;/span&gt;：&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;b&gt;[&lt;/b&gt;&lt;b&gt;一&lt;span&gt;]&lt;/span&gt;锦标赛组 &lt;/b&gt;&lt;b&gt;比赛规定和设项&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;table class=&quot;MsoNormalTable ke-zeroborder&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; width=&quot;497&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;497&quot; colspan=&quot;6&quot; style=&quot;border:solid windowtext 1.0pt;&quot;&gt;\r\n				&lt;p class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;一、锦标赛各组奖励设置：&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.65pt;&quot;&gt;\r\n					&lt;span style=&quot;font-family:宋体;&quot;&gt;锦标赛各组奖励前六名，前三名颁发奖金、奖杯、证书；&lt;span&gt;4-6&lt;/span&gt;名颁发奖杯、证书。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;二、锦标赛各组奖金设置如下（奖金总额&lt;span&gt;12&lt;/span&gt;万元）：&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;注明：锦标赛组别：&lt;span style=&quot;color:red;&quot;&gt;（注明：不足&lt;span&gt;6&lt;/span&gt;对选手参赛，比赛不发奖金；不足&lt;span&gt;3&lt;/span&gt;对选手参赛，该组别取消。）&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.65pt;&quot;&gt;\r\n					&lt;span style=&quot;font-family:宋体;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;、职业组比赛奖金：第一名&lt;span&gt;5000&lt;/span&gt;元、第二名&lt;span&gt;3000&lt;/span&gt;元、第三名&lt;span&gt;2000&lt;/span&gt;元，&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.65pt;&quot;&gt;\r\n					&lt;span style=&quot;font-family:宋体;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;、&lt;span&gt;A &lt;/span&gt;组&lt;span&gt;&amp;nbsp; &lt;/span&gt;比赛奖金：第一名&lt;span&gt;3000&lt;/span&gt;元、第二名&lt;span&gt;2000&lt;/span&gt;元、第三名&lt;span&gt;1000&lt;/span&gt;元，&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.65pt;&quot;&gt;\r\n					&lt;span style=&quot;font-family:宋体;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;、双人精英组比赛奖金：第一名&lt;span&gt;800&lt;/span&gt;元、第二名&lt;span&gt;600&lt;/span&gt;元、第三名&lt;span&gt;400&lt;/span&gt;元，&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.65pt;&quot;&gt;\r\n					&lt;span style=&quot;font-family:宋体;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;、单人精英组比赛奖金：第一名&lt;span&gt;500&lt;/span&gt;元、第二名&lt;span&gt;400&lt;/span&gt;元、第三名&lt;span&gt;300&lt;/span&gt;元，&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;三、锦标赛组比赛规定：&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.65pt;&quot;&gt;\r\n					&lt;span style=&quot;font-family:宋体;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;、职业组选手禁报专业组、业余组比赛，专业院校学生，禁报业余组别比赛。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:21.65pt;&quot;&gt;\r\n					&lt;span style=&quot;font-family:宋体;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;、同一对双人精英组选手不能兼报参加多个精英组比赛。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&