n style=&quot;font-family:宋体;&quot;&gt;年后&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;span&gt;&amp;nbsp;&lt;/span&gt; \r\n&lt;/p&gt;','13318366333',1485964800,1486915200,1487779200,1487939674,1487520000,8,4,0,1483793160,1487735355),(9,'2016年广东省标准舞、拉丁舞季度晋级赛','1111','222',1483977600,1485446400,1485014400,1485532800,1484668800,11,3,0,1484189012,1488444467),(10,'2017年广东省第三届青少年标准舞、拉丁舞锦标赛','&lt;p style=&quot;text-align:center;text-indent:23.35pt;margin-left:-20.05pt;&quot; class=&quot;MsoNormal&quot; align=&quot;center&quot;&gt;\r\n	&lt;b&gt;广东省第三届青少年标准舞、拉丁舞锦标赛&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:center;&quot; class=&quot;MsoNormal&quot; align=&quot;center&quot;&gt;\r\n	&lt;b&gt;竞赛规程&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	一、主办单位：广东省青少年舞蹈协会&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	二、承办单位：佛山市运动家文化策划有限公司&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:94.6pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	佛山市禅舞培训中心&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	三、竞赛时间与地点：&lt;span&gt;2017&lt;/span&gt;年&lt;span&gt;4&lt;/span&gt;月&lt;span&gt;22&lt;/span&gt;日星期六在佛山市体育馆举行。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	四、竞赛项目（见项目设项表）&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot;&gt;\r\n	五、参加单位：各地协会、俱乐部、院校、培训中心、学校及个人均可参赛，队数不限。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	六、参加办法&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（一）具有市（区）级以上医院证明身体健康者均可参赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（二）比赛期间，参赛者请携带身份证或户口本原件，以甄别资格。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（三）各参赛队可报领队、教练各&lt;span&gt;1&lt;/span&gt;名，参赛人数不限。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	七、竞赛办法&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（一）比赛分预赛、复赛、半决赛、决赛进行。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（二）比赛采用国家体育总局审定的最新体育舞蹈竞赛规则。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	八、奖励办法（各精英组前三名竞争&lt;span&gt;20&lt;/span&gt;万元总奖金）&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	1、&lt;span&gt;A&lt;/span&gt;组前三名颁发奖金、奖杯、证书；&lt;span&gt;4-6&lt;/span&gt;名颁发奖杯、证书。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	2、各年龄段精英组前三名颁发奖金、奖杯、证书；&lt;span&gt;4-6&lt;/span&gt;名颁发奖杯、证书。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	3、各专业组别前三名颁发奖牌、证书；&lt;span&gt;4-6&lt;/span&gt;名颁发证书。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	4、大、中专院校组及业余各组前三名颁奖牌、证书；&lt;span&gt;4-8&lt;/span&gt;名颁发证书。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	5、参赛选手均获精美礼品一份，参赛单位颁发最佳组织奖奖金、证书。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	九、报名与报到&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（一）报名：&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	1、报名表格 下载。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	2、报名截止日期：&lt;span&gt;3&lt;/span&gt;月&lt;span&gt;25&lt;/span&gt;日登录“武林号外”比赛通进行报名\r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	(1)在电脑登录&lt;a href=&quot;http://www.cwdance.cn&quot; target=&quot;_blank&quot;&gt;www.cwdance.cn&lt;/a&gt;进入比赛通进行报名。\r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	(2)在手机微信关注“武林号外”公众号，点击比赛通进行报名。\r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.35pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;3&lt;/b&gt;&lt;b&gt;、参加精英组选手报名时必须填写身份证号码，虚报者取消成绩不发奖金。&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	4、咨询电话：&lt;span&gt;0757-82361796&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（二）报到：&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	1、报到日期、时间：&lt;span&gt;4&lt;/span&gt;月&lt;span&gt;21&lt;/span&gt;日&lt;span&gt;14:00-16:30&lt;/span&gt;时。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	2、报到地点：佛山体育馆训练馆顶层佛山市禅舞培训中心。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:20.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	3、&lt;span&gt;4&lt;/span&gt;月&lt;span&gt;21&lt;/span&gt;日&lt;span&gt;16:30&lt;/span&gt;时在禅舞培训中心召开领队、教练联席会议。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	十、经费&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（一）各队交通费、食宿费自理。&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（二）报名费请汇入以下账户：&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:40.55pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	开户行：交通银行佛山分行，户 名：陈莘，账号&lt;span&gt;:622262 371000 3511859&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	十一、其它规定：&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（一）比赛舞种：&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:40.55pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	5支舞：&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;、&lt;span&gt;F&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;、&lt;span&gt;VW&lt;/span&gt;；&lt;span&gt;S&lt;/span&gt;、&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R&lt;/span&gt;、&lt;span&gt;P&lt;/span&gt;、&lt;span&gt;J&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:40.55pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	4支舞：&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;、&lt;span&gt;F&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;；&lt;span&gt;S&lt;/span&gt;、&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R&lt;/span&gt;、&lt;span&gt;J &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:40.55pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	3支舞：&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;；&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R&lt;/span&gt;、&lt;span&gt;J &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:40.55pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	2支舞：&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;T&lt;/span&gt;；&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R &lt;/span&gt;（12岁以下各组：&lt;span&gt;W&lt;/span&gt;、&lt;span&gt;Q&lt;/span&gt;；&lt;span&gt;C&lt;/span&gt;、&lt;span&gt;R&lt;/span&gt;）&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（二）比赛服装要求： 比赛服装及服饰均按中国体育舞蹈联合会规定。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（三）报名规定与参赛资格：&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:13.5pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	1、专业院校学生不得参加业余组比赛；业余选手可兼报相应的专业&lt;span&gt;B&lt;/span&gt;组比赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:13.5pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	2、凡在全国与全省比赛中已获奖的选手不得参加单项组比赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:13.5pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	3、年龄小选手可兼报大一岁年龄组别比赛，不能兼报小一岁年龄组别比赛。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:6.75pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;4、男选手可带不同女舞伴参赛，最多可兼报&lt;span&gt;4&lt;/span&gt;小项的比赛，但选手检录由此引起误场责任自负。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:13.5pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	5、精英组选手可兼报相应年龄段&lt;span&gt;A&lt;/span&gt;或&lt;span&gt;B&lt;/span&gt;组，但相同比赛项目同年龄段&lt;span&gt;A&lt;/span&gt;、&lt;span&gt;B&lt;/span&gt;组不能同时兼报（如报&lt;span&gt;10&lt;/span&gt;岁&lt;span&gt;A&lt;/span&gt;组拉丁舞不能兼报&lt;span&gt;10&lt;/span&gt;岁&lt;span&gt;B&lt;/span&gt;组拉丁舞）。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:13.55pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;6&lt;/b&gt;&lt;b&gt;、患有疾病者谢绝参赛，违者后果自负。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:13.25pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	7、凡违反规定&lt;span&gt;,&lt;/span&gt;一经查明，取消其参赛资格与成绩，并追究组队单位责任。&lt;b&gt;&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（四）请各队认真做好组队报名工作，确保选手参赛组别不误不漏。报到时一律不得更改已报的组别，如需要更改的，必须经大赛组委会同意后方能更改，并交纳组别更改手续费&lt;span&gt;200&lt;/span&gt;元。&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（五）参赛运动员禁用违禁药物。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（六）本次比赛音乐由大赛组委会统一选定。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（七）女子&lt;span&gt;6&lt;/span&gt;人组比赛音乐采用中国体育舞蹈联合会制定音乐。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	十二、裁判员及仲裁委员会由大会统一指派。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	十三、广告&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:27.05pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	如需在比赛秩序册上刊登广告的团体、个人，请尽快与佛山市禅舞培训中心联系，联系电话：&lt;span&gt;13702925237&lt;/span&gt;。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	十四、本次比赛的摄影录像权及衍生作品的版权、著作权归本次赛事组委会所有，组委会有权对本次赛事进行录像并制作光盘等宣传品发行、出售。&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	十五、本次比赛的规程、竞赛日程安排、报名表以及比赛筹备信息及赛后成绩公布等，均在佛山市禅舞舞蹈培训机构网站公布。网址：&lt;b&gt;&lt;span&gt;http:// &lt;a href=&quot;http://www.gdpopsports.com/&quot; target=&quot;_blank&quot;&gt;www.cwdance.&lt;/a&gt;cn&lt;/span&gt;&lt;/b&gt;&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;十六、保险事宜&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:26.85pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;参赛单位与运动员必须自行购买人身意外保险，如比赛期间出现意外伤亡，责任自负。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	十七、本竞赛规程解释权属主办单位，未尽事宜，另行通知。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	附件：比赛项目表&lt;span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:center;&quot; class=&quot;MsoNormal&quot; align=&quot;center&quot;&gt;\r\n	&lt;b&gt;第三届广东省青少年标准舞、拉丁舞锦标赛项目表&lt;span&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;table class=&quot;MsoNormalTable&quot; border=&quot;1&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td valign=&quot;top&quot; width=&quot;687&quot; colspan=&quot;16&quot;&gt;\r\n				&lt;p style=&quot;text-align:center;&quot; class=&quot;MsoNormal&quot; align=&quot;center&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:14pt;&quot;&gt;[&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:14pt;&quot;&gt;一&lt;span&gt;]&lt;/span&gt;锦标赛&lt;span&gt;A&lt;/span&gt;组及精英组比赛规定和设项&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;一、&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;奖项设&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;置：各&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;组奖励&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;前六名，前三名&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;颁发奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;金、&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;杯、&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;证书&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;。&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;二&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;、各&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;组奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;金&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;设&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;置如下（&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;金&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;总额&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;12&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;万元）&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p style=&quot;text-indent:19.65pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;注明：&lt;span style=&quot;color:red;&quot;&gt;不足&lt;span&gt;6&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:red;&quot;&gt;对选&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;color:red;&quot;&gt;手&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:red;&quot;&gt;参赛&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;color:red;&quot;&gt;，比&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:red;&quot;&gt;赛&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;color:red;&quot;&gt;不&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:red;&quot;&gt;发奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;color:red;&quot;&gt;金；不足&lt;span&gt;3&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:red;&quot;&gt;对选&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;color:red;&quot;&gt;手&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:red;&quot;&gt;参赛&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;color:red;&quot;&gt;，&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:red;&quot;&gt;该组别&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;color:red;&quot;&gt;取消。&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p style=&quot;text-indent:19.65pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;1&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;、&lt;span&gt;A &lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;组&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;比&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;赛奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;金：第一名&lt;span&gt;3000&lt;/span&gt;元、第二名&lt;span&gt;2000&lt;/span&gt;元、第三名&lt;span&gt;1000&lt;/span&gt;元，&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p style=&quot;text-indent:19.65pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;2&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;、&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;双&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;人精英&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;组&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;比&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;赛奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;金：第一名&lt;span&gt;800&lt;/span&gt;元、第二名&lt;span&gt;600&lt;/span&gt;元、第三名&lt;span&gt;400&lt;/span&gt;元，&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p style=&quot;text-indent:19.65pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;3&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;、&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;单&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;人精英&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;组&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;比&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;赛奖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;金：第一名&lt;span&gt;500&lt;/span&gt;元、第二名&lt;span&gt;400&lt;/span&gt;元、第三名&lt;span&gt;300&lt;/span&gt;元，&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;三、比&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;赛规&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;定：&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p style=&quot;text-indent:19.65pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;1&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;、&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;专业组选&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;手禁&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;报业&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;余&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;组别&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;比&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;赛&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;。&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \r\n				&lt;/p&gt;\r\n				&lt;p style=&quot;text-indent:19.65pt;&quot; class=&quot;MsoNormal&quot;&gt;\r\n					&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;2&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Batang;&quot;&gt;、同一&lt;/span&gt;&lt;/b&gt;&lt;b&gt;